def x_or_y(n, x, y):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    return x if is_prime(n) else y

def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return sum(1 for c in extension if c.isupper()) - sum(1 for c in extension if c.islower())

    strongest = max(extensions, key=lambda x: (strength(x), -extensions.index(x)))
    return f"{class_name}.{strongest}"

def even_odd_count(num):
    even_count = len([int(digit) for digit in str(num) if int(digit) % 2 == 0])
    odd_count = len([int(digit) for digit in str(num) if int(digit) % 2 != 0])
    return (even_count, odd_count)

def int_to_mini_roman(number):
    roman_numerals = {
        1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l', 90: 'xc',
        100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'
    }

    result = ''
    for value, numeral in sorted(roman_numerals.items(), reverse=True):
        while number >= value:
            result += numeral
            number -= value

    return result.lower()

def find_max(words):
    def count_unique_chars(word):
        return len(set(word))

    max_unique_chars = 0
    result_word = ""

    for word in words:
        unique_chars = count_unique_chars(word)
        if unique_chars > max_unique_chars or (unique_chars == max_unique_chars and word < result_word):
            max_unique_chars = unique_chars
            result_word = word

    return result_word

def do_algebra(operators, operands):
    expression = str(operands[0])
    for i in range(1, len(operands)):
        expression += operators[i-1] + str(operands[i])
    return eval(expression)

import hashlib

def string_to_md5(text: str) -> str:
    if not text:
        return None
    return hashlib.md5(text.encode()).hexdigest()
